import React, { useState } from 'react';
import './CSS/LoginSignup.css'

const LoginSignup = () => {
    const [state,setstate] = useState("Login");

    const login = async ()=>{
        console.log("Login Function Executed");

    }
    const signup = async ()=>{
        console.log("Sign Up Function Executed");

    }



    return (
        <div className='loginsignup'>
            <div className="loginsignup-container">
                <h1>{state}</h1>
                <div className="loginsignup-fields">
                  {state === "Sign Up"? <input type="text" placeholder='Your Name' name='Name'/>:<></> }
                   <input type="email" placeholder='E-mail Address' name='e-mail' />
                   <input type="password" placeholder='Password' name='password' />
                </div>
                <button onClick={()=>{state === "Login"?login():signup()}} >Continue</button>
                {state === "Sign Up"?<p className="loginsignup-login">Alreasy have an account? <span onClick={()=>{setstate("Login")}} >Login here</span></p>
                                     :<p className="loginsignup-login">Create an account? <span onClick={()=>{setstate("Sign Up")}}>Click here</span></p>}
                <div className="loginsignup-agree">
                    <input type="checkbox" name='' id='' />
                    <p>By continuing I agree to the terms of use and policies</p>

                </div>
            </div>

        </div>
    );
}

export default LoginSignup;
